script: |
  super -f text -I q4309.spq | sort > q4309.out

inputs:
  - name: q4309.spq
    data: |
      SELECT + col1 AS col0, - col2 + + - 9 + + - 72 * + CAST ( + + ( + col2 ) AS REAL ) AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL IS NULL;
  - name: tab1

outputs:
  - name: q4309.out
    data: |
